import './App.css';
import upper, {text1, text2, text3} from './file1'
import React from "react";
import person, {males, females} from './file2';

function App() {  
  const {firstName, email} = person;  
  return(
    <div className="App">
      <h2>Ex 1</h2>
      <p>{upper("please uppercase me")}</p>
      <p>{upper(text1)}</p>
      <p>{upper(text2)}</p>
      <p>{upper(text3)}</p>
      <h2>Ex 2</h2>
      <p>{upper(firstName)}</p>
      <p>{upper(email)}</p>

    </div>
  );
}

export default App;
